- input: "TEXT\x1CC00030718\x1C1\x1C\x1CF3XN\x1CFor Line 21b of this report, the following
    disbursements represent advance costs for independent expenditures that were not
    publicly disseminated during this reporting period, but instead will be disseminated
    in future reporting periods:  9/23/10 Terris Barnes & Walters for $366,563; 9/24/10
    TargetSmart Communications for $9,610; 9/29/10 Fenn Communications for $304,000
    & $100,000. For the contra disbursement amounts of $100 on 9/21/10, $100 on 9/27/10,
    and $100 on 9/30/10 reported on Line 21b of this report and transferred to Line
    24, the full purpose of disbursement should be noted as: Independent Expenditure
    disseminated, see Line 24 item.  These amounts relate to an original $4,250 advance
    payment made to the National Association of Realtors for consulting services on
    8/22/2008 & reported on Line 21b of the September 2008 monthly report.  Subsequently
    in 2008 and July 2010, we utilized $3,950 of this advanced payment as consulting
    services attributable to independent expenditures & reflected as negative amounts
    on Line 21b & transferred to Line 24.  The remaining $300 of the original $4,250.00
    is being utilized as consulting services attributable to independent expenditures
    & reflected on Line 24 in this period, with the full purpose of disbursement for
    each as: Transfer consulting services from Line 21b to Line 24 due to public dissemination
    of independent expenditure communications & attributed as follows: 9/21/10 $100
    for Paul Kanjorski; 9/27/10 $100 for Paul Kanjorski; 9/30/10 $100 for Ken Calvert.
    \ For the following items, a negative amount is reflected for each on Line 21b
    of this report and a corresponding positive amount is reflected on Line 24.  For
    the Line 21b negative entries, the full purpose of disbursement should be noted
    as Transfer to Line 24, Independent Expenditure disseminated.  For the Line 24
    corresponding positive entries, the full purpose of disbursement for each is:
    \ Transfer survey costs from Line 21b to Line 24 due to public dissemination of
    independent expenditure communication.  Items are:  Peter D Hart Research  $26,900
    on 9/21/10 for Paul Kanjorski  & $27,050 on 9/30/10 for Bill Foster;  NMB Research
    \ $22,000 on 9/24/10 for Dave Reichert & $22,000 on 9/30/10 for Patrick Tiberi;
    Public Opinion Strategies $22,000 on 9/24/10 for Ken Calvert.  \n"
